// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Register {
    struct User {
        string name;
        string email;
        string profileimage;
        uint userId;
    }

    mapping(address => User) public usersMapping;
    mapping (address => bool) public isUserAddMapping;

    function setUser(string memory _name , string memory _email , string memory _profileImage , uint _userId) public {
         //  Check if the user is already registered
          require(!isUserAddMapping[msg.sender],"User is already Registered");
          usersMapping[msg.sender]=User(_name ,  _email , _profileImage,_userId);
          isUserAddMapping[msg.sender]=true; 
    }

    function getUser(address _address) public view returns (User memory) {
         return usersMapping[_address];
    }
}

